import React, { useContext } from "react";
import { Link, useNavigate } from "react-router-dom";
import UserRegisterContex from "../Store/UserRegisterContex";
export const Header = () => {
  const navigate = useNavigate();
  const [state, dispatch] = useContext(UserRegisterContex);
  const username= localStorage.getItem("user");
  console.log(username.map);
  const userLogout = () => {
    let userdata = {
      isLogin: false,
    };
    dispatch({
      type: "logoutUser",
      payload: userdata,
    });
    navigate("/");
  };
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
  <div className="container-fluid">
    <div className="collapse navbar-collapse" id="navbarSupportedContent">
      <ul className="navbar-nav me-auto mb-2 mb-lg-0 h3">
        <li className="nav-item">
        <Link to="/Homepage" className="nav-link">Home</Link>
        </li>
        <li className="nav-item">
        <Link to="/Features" className="nav-link">Features</Link>
        </li>
        <li className="nav-item">
        <Link to="/Aboutus" className="nav-link">About-Us</Link>
        </li>
      </ul>
      <div className="d-flex">
      <ul className="navbar-nav mr-auto mb-0 h3">
        <li>
          <a className="nav-link" onClick={userLogout}>
            Logout
          </a>
        </li>
      </ul>
      </div>
    </div>
  </div>
</nav>

  );
};
